import React, { useEffect, useState } from "react";
import NavBar from "./dashComponents/NavBar";

const Dashboard = ({ setAuth }) => {
  return (
    <div>
      <NavBar setAuth={setAuth}/>
      <ul class="stepper">
                <li class="stepper__item complete">Application</li>
                <li class="stepper__item current">Processing</li>
                <li class="stepper__item">Funding</li>
      </ul>
    </div>
  );
};

export default Dashboard;
